function recipeStuffing() {
	var err = {"code":0,"msg":""};
	var meta = {"v":"1","region":"CN","ok":true,"err":err};
	var stuffing = [];
	for (i = 1; i < 5; i++) {
		var id = Math.floor(Math.random() * 6) + 1;
		if(id == 1) var row = {"id":1,"name":"蜂蜜"};
		else if(id == 2) var row = {"id":2,"name":"茶叶"};
		else if(id == 3) var row = {"id":3,"name":"果酱"};
		else if(id == 4) var row = {"id":4,"name":"芋泥"};
		else if(id == 5) var row = {"id":5,"name":"可可"};
		else if(id == 6) var row = {"id":6,"name":"秘密酱料"};
		stuffing.push(row);
	}
	var data = {"stuffing":stuffing};
	var json = {"meta":meta,"data":data};
	return JSON.stringify(json);
}

